comment:
아 지금 생각해보니깐 오늘 친구한테 빌려준 체육복 사물함에 넣었는지 기억안남
아니 안빌려줬으면 이런 걱정 안해도 돼는데 항상 체육복 빌릴때만 친한척함;; 친한척 하니깐 안빌려줄수도 없고
거의 이름도 잊고 살았는데 내가 젤 호구같으니깐 빌리러 오니깐 구역질 나더라;;;;

한입충 진짜싫다..
어제학교 방송부에서 나눠준 카프리썬 6교시체육끝나고 빨때 꼽아서 먹을라구 딱 꼽았는데 뒤에서 친하지도않은 같은반남자애가와서 먹고 감..;;;;;;
어우 허락도안받구 진짜 빨때로 먹었길레 결국 먹지도못하고버렸는데 어찌나 서럽던지..

ㅣ년전에 반회장부회장 선거 있던 날 1시간전에 제가 펜으로 그림 선 따는데 한 남자애가 일부로 치고 가서(친 다음에 막 웃으면서 도망쳤거든요) 제가 개빡쳐서 쫓아가니깐 남자애들이 "부회장후보가(제가 회장&부회장 후보로 나가려고 했음) 그래도 돼~?"이럼...
하 진짜 쌍으로 빡치는날이였다
기억나냐 ㅂㄱㅇ? 뭐? 화나면 니 책상이나 때리라고? 내가 책상을 너라 생각하고 통토로통통툐ㅡㅇ하고 치라고? 와;;;;

막베댓?
아니 160,170못넘으면 꼬맹이라고 지정해놨음?
왜 님맘대로 꼬맹이라고 갖다붙이심;

ㄹㅇ 저거 진짜 속상합니다..
그래놓곤 내가 안그려줬더니
나 나쁜년만듬;;

실물보다 예쁘게 그려준다:뭐? 내가 이렇게 예뻐..?;;
최대한 비슷하게 그려준다:뭐야,내가  이렇게 생겼어?

예쁘게 그려줘도 뭐래..;; 어쩌라는...

니들은 주제 정해놓고 그리냐고ㅠㅜ
이래놓고 아..그냥..ㅎ이러면 뭐야..이러고 지나가잖아..;;
그거 극혐이야 진짜ㅠ

난 머리좀 치워줄래.. 라고 말하기 좀 그래서
내가 알아서 피해보는데 그 키큰애가 너무 움직여서 나도 따라서 반대로 움직이게 된다
머리치워달라고는 안할테니 제발 가만히좀 있어 칠판좀 보자.. 수업시간에 왜 계속 옆자리애랑 떠들면서 허리 흔들어제끼냐고;

우리학교 이*원 이란 얘가 힘약한 얘들 괴롭히면서
걔네가 조금만 붕어처럼 하면 개빡치는 노답 있는데
보고있으면 니 좀 반성해라;

아니 진짜 인성이ㅋㅋ
누군 앞아서 불편하게 그 목발 하는데 그걸 친구란애들이 뺏어서 심지어 가지고 노냐..
그건 아니지;
